css:
.nuclide-diagnostics-ui-table-container {
  display: flex;
  flex-direction: column;
  overflow-y: hidden;
}
.nuclide-diagnostics-ui-table-container > div:first-child {
  display: flex;
  overflow: hidden;
  flex-direction: column;
}
.nuclide-diagnostics-ui-table-container .nuclide-ui-table {
  border-top-width: 0;
  border-left-width: 0;
  border-right-width: 0;
}
.nuclide-diagnostics-ui-table-container .nuclide-ui-table td:last-child,
.nuclide-diagnostics-ui-table-container .nuclide-ui-table th:last-child {
  border-right-width: 0;
}
.nuclide-diagnostics-ui-table-container-empty .nuclide-ui-table {
  border-bottom-width: 0;
}
.nuclide-diagnostics-ui-table-message {
  text-align: center;
}
.nuclide-diagnostics-ui-table-message.highlight-warning,
.nuclide-diagnostics-ui-table-message.highlight-error {
  border-radius: 0;
  padding: 5px 0 10px 0;
}
.nuclide-diagnostics-ui-empty-component {
  font-style: italic;
  padding: 1em;
  text-align: center;
}
